import React from 'react'
import CarCardImage from './CarCardImage'
import { Link } from 'react-router-dom'

const CarCard = (props) => {

////////////// Car Name
  const title = props.models.cars.map((models) => 
 
    <h1>{models.cars.car_name}</h1>
   
  );

////////////// Car Picture


  const picture = props.models.cars.map((models) => 
  
    <a href={models.cars.car_picture}></a>
  
  );







  return (
    
    <div key={models.cars.id} className="car_card">
      {title}
      <CarCardImage car_picture={props.car_picture}/>

      <Link to="/expand">
        <button className="primary_button">Részletek ⯈</button>
      </Link>
    </div>

  )
}

export default CarCard
